import * as React from 'react';
import Pagination from '@mui/material/Pagination';
import Stack from '@mui/material/Stack';

export default function TablePagination({ pageCount, onPageChange, currentPage }) {
  return (
    <Stack spacing={2}>
      <Pagination
        count={pageCount}
        variant="outlined"
        shape="rounded"
        onChange={onPageChange}
        page={currentPage}
      />
    </Stack>
  );
}
